import React, {Component} from "react";
import Customer from "./Customer";

class UserProfile extends Component{
    render(){
        return(
            <div>
                <h2>USER PROFILE</h2>
                <Customer />
                {/* <Customer /> here add multiple */}
                <p>User Name: JOHN DEO</p>
                <p>Email: john.bec@gmaiilcom</p>
            </div>
        );
    }
}
export default UserProfile;
